import Card from "./UI/Card";
import { Link } from "react-router-dom";
const MainDashboardItem = (props) => {
  return (
    <li>
      <Card>
        <img src={props.image} alt={props.title} />
        <p>{props.title}</p>
      </Card>
    </li>
  );
};

export default MainDashboardItem;
